<!DOCTYPE html>
<html>
<head>
  <style>
    body {
      margin: 0;
      overflow: hidden;
      background: black;
      display: flex;
      flex-direction: column;
      align-items: center;
      font-family: Arial, sans-serif;
    }
    
    #controls {
      position: fixed;
      top: 20px;
      left: 20px;
      z-index: 100;
      color: white;
      background: rgba(0,0,0,0.7);
      padding: 15px;
      border-radius: 8px;
    }
    
    #starfield {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
    }
    
    .name {
      position: absolute;
      color: white;
      transform-style: preserve-3d;
      pointer-events: none;
      font-size: 40pt;
      font-family:'Courier New', Courier, monospace;
    }
    
    button {
      background: #444;
      color: white;
      border: none;
      padding: 8px 16px;
      border-radius: 4px;
      cursor: pointer;
      margin: 5px 0;
    }
    
    button:hover {
      background: #666;
    }
    
    input {
      width: 60px;
      margin-left: 8px;
    }
  </style>
</head>

    ];

    
    class NameStar {
      constructor() {
        this.reset();
        this.element = document.createElement('div');
        this.element.className = 'name';
      }
      
      reset() {
        this.x = (Math.random() - 0.5) * 2000;
        this.y = (Math.random() - 0.5) * 2000;
        this.z = Math.random() * 25000 + 1000;
        this.name = names[Math.floor(Math.random() * names.length)];
      }
      
      update() {
        this.z -= Math.random() * 30 + 15
        
        if (this.z < 0) {
          this.reset();
        }
        
        const scale = 1000 / this.z;
        const x = this.x * scale + window.innerWidth / 2;
        const y = this.y * scale + window.innerHeight / 2;
        
        // Calculate opacity based on z position
        const opacity = Math.min(Math.max((this.z - 100) / 1000, 0), 1);
        // Calculate blur based on z position
        const blur = Math.max((1000 - this.z) / 100, 0);
        
        this.element.style.transform = `translate(${x}px, ${y}px) scale(${scale})`;
        this.element.style.opacity = opacity;
        this.element.style.filter = `blur(${blur}px)`;
        this.element.textContent = this.name;
      }
    }
    
    let nameStars = [];
    const starfield = document.getElementById('starfield');
    
    function initStarfield(count) {
      // Clear existing stars
      starfield.innerHTML = '';
      nameStars = [];
      
      // Create new stars
      for (let i = 0; i < count; i++) {
        const nameStar = new NameStar();
        nameStars.push(nameStar);
        starfield.appendChild(nameStar.element);
      }
    }
    
    function animate() {
      nameStars.forEach(star => star.update());
      requestAnimationFrame(animate);
    }
    
    function restartAnimation() {
      const count = parseInt(document.getElementById('numNames').value);
      initStarfield(Math.min(Math.max(count, 1), 1000));
    }
    
    // Initial setup
    restartAnimation();
    animate();
  </script>
